import React, {useState} from "react";
import useStyles from "../Form/styles.js";
import { TextField, Button, Typography, Paper } from "@material-ui/core";
const Form = () => {
  const classes = useStyles();
  const handleSubmit = () => {};
  const [postData,setPostData] = useState({
    creator: "", title: "", message: "",tags: "", selectedFile: ""
  });
  return (
    <>
      <Paper className={classes.paper}>
        <form autoComplete="off" className={classes.form} noValidate onSubmit={handleSubmit}>
          <Typography variant="h6">Creating a Memories</Typography>
            <TextField 
              name="creator" 
              variant="outlined" 
              label="Creator" 
              fullWidth 
              value={postData.creator} 
              onChange={(e)=> setPostData({...postData, creator:e.target.va})}/>
        </form>
      </Paper>
    </>
  );
};

export default Form;
